import React from "react"

// Photo imports
import Logo from "../Photos/EchoBond_logo.png"

// Navbar item
function Navbar () {
    return (
        <nav className="bg-gradient-to-r from-start via-middle to-end w-full">
            <div className="flex flex-row justify-between">
                <div className="flex flex-row justiy-center items-center">
                    <img src={Logo} alt="Logo" className="w-24 h-24"/>
                    <h4 className="text-white"> EchoBond </h4>
                </div>
            </div>
        </nav>
    )
}

export default Navbar
